import { TextField } from '@material-ui/core'
import React, { useEffect, useState } from 'react'
import { connect } from 'react-redux'
import { Link } from 'react-router-dom'
import { getWorkers } from '../../main_redux/actions/workers'
import './style.css'

function Enter ()  {

    useEffect(() => {
        props.set('workers', getWorkers)
      }, []);

    const [login, setLogin] = useState('')
    const [password, setPassword] = useState('')

    return(
        <div className='enter__position'>
            <div>
            Enter
            </div>
        <TextField label='login' onChange={(e) => setLogin(e.target.value)} value={login}/>
        <TextField type='password' label='password' onChange={(e) => setPassword(e.target.value)} value={password}/>

        <Link to='/brands_list'>log in</Link>
        </div>
    )
}
export default connect(
    state => ({
        workers: state.workers.workers
    })
)(Enter)
